import React from 'react';
import './App.css';
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Home from "./components/Home";

function App() {
  return (
    <div className="app">
      <Router>
        <div className="app">
          <Switch>

            <Route path="/">
              <Header/>
              <Home/>
              <Footer/>
            </Route>

          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
